import sys
import re

def get_first_unique(lst):
    d = {}

    for el in lst:
        d[el] = d.get(el, 0) + 1

    for el, occur in d.items():
        if occur == 1:
            return el
        
    raise ValueError("No unique elements in the list")

if (len(sys.argv) != 2):
    print("Usage: python porta.py <path to file>")
    sys.exit(1)

file_path = sys.argv[1]

try:
    with open(file_path, 'r') as f:
        text = f.read()

    words = re.findall(r'\b\w+\b', text)

    unique_letters = []

    for word in words:
        try:
            unique_letters.append(get_first_unique(word))
        except:
            pass

    if len(unique_letters) != 0:
        try:
            print(get_first_unique(unique_letters))
        except:
            print("No unique letters among words' unique letters")
    else:
        print("None of the words have unique letters")

except FileNotFoundError:
    print(f"File not found")
    sys.exit(1)

except IOError:
    print(f"Error reading file")
    sys.exit(1)

#include <iostream>

using namespace std;

class Set {

public:

	struct Node {
		int value = 0;
		Node* left = nullptr;
		Node* right = nullptr;
		Node* parent = nullptr;
	};

	void Insert(const int& val) {
		if (root == nullptr) {
			root = new Node{ val, nullptr, nullptr, nullptr };
			size++;
			return;
		}
		Node* parent = nullptr;
		Node* node = root;
		while (node != nullptr && node->value != val) {
			parent = node;
			node = node->value > val ? node->left : node->right;
		}
		if (node == nullptr) {
			Node* temp = new Node{ val, nullptr, nullptr, parent };

			parent->value > val ? parent->left = temp : parent->right = temp;
			size++;
		}
	}

	void Print() {
		Print(root);
		cout << endl;
	}

	void Print(Node* node) {
		if (node != nullptr) {
			Print(node->left);
			cout << node->value << " ";
			Print(node->right);
		}
	}

	int Size() {
		return size;
	}

private:
	int size = 0;
	Node* root = nullptr;
};


void main() {
	Set tr;
	srand(time(NULL));
	int arr[]{ 45, 30, 50, 27, 39, 90, 30, 15, 70, 93 };
	for (int i = 0; i < 10; i++) {
		//int val = rand() % 100;
		int val = arr[i];
		cout << val << " ";
		tr.Insert(val);
	}
	cout << endl << endl;

	tr.Print();
}

#include <WiFi.h>
#include <UniversalTelegramBot.h>

// Konfigurasi WiFi
const char* ssid = "nama_wifi";
const char* password = "kata_sandi_wifi";

// Konfigurasi bot Telegram
#define BOT_TOKEN "token_bot_anda"
#define CHAT_ID "chat_id_anda"

// Pin sensor status tempat sampah
const int trashStatusPin = 2;

// Variabel penanda status tempat sampah
bool trashFull = false;

// Objek untuk koneksi WiFi
WiFiClientSecure client;

// Objek bot Telegram
UniversalTelegramBot bot(BOT_TOKEN, client);

void setup() {
  // Menginisialisasi pin sensor tempat sampah sebagai input
  pinMode(trashStatusPin, INPUT);

  // Menghubungkan ke jaringan WiFi
  WiFi.begin(ssid, password);
  while (WiFi.status() != WL_CONNECTED) {
    delay(1000);
    Serial.println("Connecting to WiFi...");
  }
  Serial.println("Connected to WiFi");

  // Memulai koneksi Telegram
  client.setInsecure();
}

void loop() {
  // Membaca status tempat sampah
  bool currentTrashStatus = digitalRead(trashStatusPin);

  // Memeriksa apakah tempat sampah penuh
  if (currentTrashStatus && !trashFull) {
    trashFull = true;
    sendTelegramMessage("Tempat sampah sudah penuh!");
  } else if (!currentTrashStatus && trashFull) {
    trashFull = false;
    sendTelegramMessage("Tempat sampah sudah dikosongkan.");
  }

  delay(1000); // Jeda 1 detik antara setiap pembacaan status tempat sampah
}

// Fungsi untuk mengirim pesan ke bot Telegram
void sendTelegramMessage(String message) {
  String chatId = CHAT_ID;
  if (chatId.length() > 0) {
    if (bot.sendMessage(chatId, message, "Markdown")) {
      Serial.println("Message sent successfully");
    } else {
      Serial.println("Failed to send message");
    }
  } else {
    Serial.println("Chat ID not set");
  }
}

#include <iostream>

using namespace std;

template<typename T>
class List {
public:

    struct Node { // двусвязный список состоит из узлов
        T value; // узел хранит информативную часть
        Node* next; // указатель на следующий узел в списке
        Node* prev; // указатель на предыдущий узел
    };

    List() : size(0), head(nullptr), last(nullptr) {}

    List(const List& other) : size(other.size), head(nullptr), last(nullptr) {
        if (other.head != nullptr) {
            head = new Node{ other.head->value, nullptr, nullptr };
            Node* temp = head;
            Node* other_temp = other.head;
            while (other_temp->next != nullptr) {
                other_temp = other_temp->next;
                temp->next = new Node{ other_temp->value, nullptr, temp };
                temp = temp->next;
            }
            last = temp;
        }
    }

    List(List&& other) : size(other.size), head(other.head), last(other.last) {
        other.size = 0;
        other.head = nullptr;
        other.last = nullptr;
    }

    List& operator=(const List& other) {
        if (this != &other) {
            Clear();
            if (other.head != nullptr) {
                head = new Node{ other.head->value, nullptr, nullptr };
                Node* temp = head;
                Node* other_temp = other.head;
                while (other_temp->next != nullptr) {
                    other_temp = other_temp->next;
                    temp->next = new Node{ other_temp->value, nullptr, temp };
                    temp = temp->next;
                }
                last = temp;
                size = other.size;
            }
        }
        return *this;
    }

    List& operator=(List&& other) {
        if (this != &other) {
            Clear();
            size = other.size;
            head = other.head;
            last = other.last;
            other.size = 0;
            other.head = nullptr;
            other.last = nullptr;
        }
        return *this;
    }

    void Push_front(const T& value) {
        if (size == 0) {
            last = head = new Node{ value, nullptr, nullptr };
            size++;
            return;
        }
        Node* temp = new Node{ value, head, nullptr };
        head->prev = temp;
        head = temp;
        size++;
    }

    void Push_back(const T& value) {
        if (size == 0) {
            last = head = new Node{ value, nullptr, nullptr };
            size++;
            return;
        }
        Node* temp = new Node{ value, nullptr, last };
        last->next = temp;
        last = temp;
        size++;
    }

    void Pop_front() {
        if (size > 0) {
            if (size == 1) {
                delete head;
                last = head = nullptr;
                size--;
                return;
            }
            head = head->next;
            delete head->prev;
            head->prev = nullptr;
            size--;
        }
    }

    void Pop_back() {
        if (size > 0) {
            if (size == 1) {
                delete head;
                last = head = nullptr;
                size--;
                return;
            }
            last = last->prev;
            delete last->next;
            last->next = nullptr;
            size--;
        }
    }

    void Insert(const int index, const int& value) {
        if (index == 0) {
            Push_front(value);
            return;
        }
        if (index == size) {
            Push_back(value);
            return;
        }
        if (index > 0 && index < size) {
            Node* temp = head;
            for (int i = 0; i < index - 1; i++) {
                temp = temp->next;
            }
            Node* node = new Node{ value, temp->next, temp };
            temp->next->prev = node;
            temp->next = node;
            size++;
        }
    }

    void Erase(const int index) {
        if (index == 0) {
            Pop_front();
            return;
        }
        if (index == size - 1) {
            Pop_back();
            return;
        }
        if (index > 0 && index < size - 1) {
            Node* temp = head;
            for (int i = 0; i < index - 1; i++) {
                temp = temp->next;
            }
            Node* buf = temp->next->next;
            delete temp->next;
            temp->next = buf;
            temp->next->prev = temp;
            size--;
        }
    }

    void Print() {
        Node* temp = head;
        while (temp != nullptr) {
            cout << temp->value << " ";
            temp = temp->next;
        }
        cout << endl;
    }

    T& Front() {
        if (head != nullptr) {
            return head->value;
        }
    }

    T& Front() const {
        if (head != nullptr) {
            return head->value;
        }
    }

    T& Back() {
        if (last != nullptr) {
            return last->value;
        }
    }

    T& Back() const {
        if (last != nullptr) {
            return last->value;
        }
    }

    int Size() const {
        return size;
    }

    void Clear() {
        while (head != nullptr) {
            Pop_front();
        }
    }

    T& operator[] (const int index) {
        if (index >= 0 && index < size) {
            Node* temp = head;
            for (int i = 0; i < index; i++) {
                temp = temp->next;
            }
            return temp->value;
        }
    }

    const T& operator[] (const int index) const {
        if (index >= 0 && index < size) {
            Node* temp = head;
            for (int i = 0; i < index; i++) {
                temp = temp->next;
            }
            return temp->value;
        }
    }

    bool operator==(const List& other) {
        if (this->size != other.size) {
            return false;
        }
        Node* temp = head;
        Node* other_temp = other.head;
        while (temp != nullptr) {
            if (temp->value != other_temp->value) {
                return false;
            }
            temp = temp->next;
            other_temp = other_temp->next;
        }
        return true;
    }

    bool operator!=(const List& other) {
        return !(*this == other);
    }

    int Find(const T& value) {
        if (size == 0) {
            return -1;
        }
        int i = 0;
        Node* temp = head;
        while (temp != nullptr && temp->value != value) {
            temp = temp->next;
            i++;
        }
        if (temp != nullptr) {
            return i;
        }
        return -1;
    }

    ~List() {
        Clear();
    }

private:
    int size = 0;
    Node* head = nullptr;
    Node* last = nullptr;
};

int main() {
    List<int> list1;
    for (int i = 0; i < 10; i++) {
        list1.Push_front(i + 1);
        list1.Print();
    }
    cout << list1.Size() << endl;

    for (int i = 0; i < 3; i++) {
        list1.Pop_front();
        list1.Print();
    }
    cout << list1.Size() << endl;

    cout << "Front: " << list1.Front() << " Back: " << list1.Back() << endl;

    list1.Push_back(10);
    list1.Print();
    list1.Pop_back();
    list1.Print();

    cout << "list2: " << endl;
    List<int> list2(move(list1));
    list2.Print();

    cout << "list1: " << endl;
    list1.Print();

    list2.Insert(3, 12);
    cout << "list2: " << endl;
    list2.Print();
    list2.Erase(2);
    list2.Print();
    cout << list2.Find(12) << endl;
    cout << list2[3] << endl;
    List<int> list3(list2);
    cout << "list3: " << endl;
    list3.Print();
    list3[3] = 22;
    list3.Print();
    cout << boolalpha;
    cout << (list2 == list3) << endl;
    cout << (list2 != list3) << endl;
}

#include <iostream>
#include <vector>
#include <algorithm>
#include <cstdint>

int main () {
    std::int32_t Tca;
    std::cin >> Tca;

    for(std::int32_t tc = 1; tc <= Tca; tc++) {
        std::int32_t N, M;
        std::cin >> N >> M;

        std::vector<std::int32_t> T, V;
        T.reserve(N);
        V.reserve(M);

        // Reading visitors
        for(std::int32_t t = 0; t < N; t++) {
            std::int32_t t_input;
            std::cin >> t_input;

            T.push_back(t_input);
        }

        // Reading volunteers
        for(std::int32_t v = 0; v < M; v++) {
            std::int32_t v_input;
            std::cin >> v_input;

            V.push_back(v_input);
        }

        std::vector<std::vector<std::int32_t>> DP(
            N, std::vector<std::int32_t>(M, 0)
        );
            
        // Tourist and volunterr or just visitor
        DP.at(0).at(0) = T.at(0) < V.at(0) ? 2 : 1;

        // Volunter used for the first turist
        bool volunter_found = DP.at(0).at(0) == 2;
        // T[t] V[0]
        for(std::int32_t t = 1; t < N; t++) {
            if(!volunter_found && T.at(t) < V.at(0)) {
                DP.at(t).at(0) = DP.at(t - 1).at(0) + 2;
                volunter_found = true;
            } else {
                DP.at(t).at(0) = DP.at(t - 1).at(0) + 1;
            }
        }

        // T[0] V[v]
        volunter_found = DP.at(0).at(0) == 2;
        for(std::int32_t v = 1; v < M; v++) {
            if(!volunter_found && V.at(v) > T.at(0)) {
                DP.at(0).at(v) = DP.at(0).at(v) + 2;
                volunter_found = true;
            } else {
                DP.at(0).at(v) = DP.at(0).at(v - 1);
            }
        }

        for(std::int32_t t = 1; t < N; t++) {
            for(std::int32_t v = 1; v < M; v++) {
                if(T.at(t) < V.at(v)) {
                    DP.at(t).at(v) = std::max({
                        DP.at(t - 1).at(v - 1) + 2,
                        DP.at(t - 1).at(v) + 1,
                        DP.at(t).at(v - 1)
                    });
                } else {
                    DP.at(t).at(v) = std::max(
                        DP.at(t - 1).at(v) + 1,
                        DP.at(t).at(v - 1)
                    );
                }
            }
        }

        std::cout << "Case #" << tc << ": " << DP.at(N - 1).at(M - 1) << std::endl;
    }
    
    return 0;
}

