import java.awt.*;
import javax.swing.*;
import javax.swing.text.Document;

public class ETextFieldPlaceholder extends JTextField {

    private String placeholder;

    public ETextFieldPlaceholder() {
    }

    public ETextFieldPlaceholder(
            final Document pDoc,
            final String pText,
            final int pColumns) {
        super(pDoc, pText, pColumns);
    }

    public ETextFieldPlaceholder(final int pColumns) {
        super(pColumns);
    }

    public ETextFieldPlaceholder(final String pText) {
        super(pText);
    }

    public ETextFieldPlaceholder(final String pText, final int pColumns) {
        super(pText, pColumns);
    }

    public String getPlaceholder() {
        return placeholder;
    }

    @Override
    protected void paintComponent(final Graphics g) {
        super.paintComponent(g);

        if (placeholder == null || placeholder.length() == 0 || getText().length() > 0) {
            return;
        }

        final Graphics2D g2d = (Graphics2D) g;
        g2d.setRenderingHint(RenderingHints.KEY_ANTIALIASING, RenderingHints.VALUE_ANTIALIAS_ON);
        g2d.setColor(getDisabledTextColor());
        
        Font font = getFont();
        g2d.setFont(font);

        // centralizar texto no componente
        FontMetrics fm = g2d.getFontMetrics();
        int x = (getWidth() - fm.stringWidth(placeholder)) / 2;
        int y = ((getHeight() - fm.getHeight()) / 2) + fm.getAscent();

        g2d.drawString(placeholder, x, y);
    }

    public void setPlaceholder(final String s) {
        placeholder = s;
    }

}

