void  FindMileage(std::vector<Car>& cars)
{
    std::cout << "Введите пробег для поиска авто больше заданного: ";
    int mileage;
    std::cin >> mileage;
    std::vector<std::string> lf;
    for (int i = 0; i < cars.size(); i++)
        if (cars[i].mileage > mileage)
            lf.push_back(std::string(cars[i].secondname) + " " + std::string(cars[i].firstname));
    std::sort(lf.begin(), lf.end());
