public interface IAblity
  void Use(Vector3 direction)

public abstract class BaseAbilityTemplate : ScriptableObject
  public abstract IAbility CreateInstance()

public class ShootingAbilityTemplate : BaseAbilityTemplate
  public GameObject bulletPrefab;
  public float speed;
  public float damage;

  public override IAbility CreateInstance()
    return new ShotBulletAbility(this);

public abstract class BaseAbility<T> : IAblity
  where T : BaseAbilityTemplate
  
  puplic T Template {get; private set}
  public BaseAbility(T template)
    Template = template;
  
  public abstract void Use(Vector3 direction)

class ShotBulletAbility : BaseAbility<ShootingAbilityTemplate>  
  
  public override void Use(Vector3 direction)
    var bullet = Instantiate (Template.bulletPrefab); // maybe class Bullet
    bullet.transform.forward = direction;
    bullet.rigidBody.AddForce(Template.speed);
    bullet.SetDamage(Template.damage);

public class Weapon
  // some other fields required for all weapon

  public IAbility Ability { get; private set; }
  private Transform _parent;
 
  public Weapon(IAbility ability, Transform parent)
    Ability = ability;
    _parent = parent;

  public void Fire()
    Ability.Use(_parent.forward);
  

public static class WeaponFactory
  public static Weapon CreateWeapon(BaseAbilityTemplate template, Transform weaponParent)
    var ability = template.CreateInstance();
    var weapon = new Weapon(ability, weaponParent);
    return weapon;

